md"# Einleitung"

# ╔═╡ 39c95241-bb07-43e0-8ccb-a2d015e67f59
md"Der Klimawandel ist eine der größten Herausforderungen des 21. Jahrhunderts. Das Ziel ist es, klimaneutral zu werden. Dafür muss eine Unabhängigkeit von fossilen Energien geschafft werden, indem Energie gespart und erneuerbare Energien zügig ausgebaut werden. Aktuell (2022) gibt es dafür sogar eine doppelte Dringlichkeit: die sich verschärfende Klimakrise und der russische Angriffskrieg auf die Ukraine [^44].
Wenn der Anteil an regenerativer Stromerzeugung in Zukunft stark ausgebaut wird, ist das Konzept von Power-to-Gas vielversprechend. Überschüssiger Wind- oder Solarstrom kann mit Elektrolyse von Wasser zur Herstellung von Wasserstoff genutzt werden. Der Wasserstoff kann anschließend über Brennstoffzellen zurück in Strom gewandelt werden. [^45]

Im Rahmen des Forschungsprojekts FlexHyX am Institut für Technik, Ressourcenschonung und Energieeffizienz (TREE) der Hochschule Bonn-Rhein-Sieg werden mithilfe von mathematischer Modellbildung und Simulation Power-to-Gas Netzwerke simuliert. Anhand des Modells sollen Szenarienrechnungen durchgeführt werden können, um beispielsweise die Speichergröße der Batterie oder die Elektrolyseeinheit optimal auszulegen.

Es wurden bereits komplexe Modelle mit der Software MATLAB entwickelt und simuliert. Matlab ist lizenzpflichtig und mit hohen Kosten verbunden. Eine gute kostenlose Alternative ist die moderne Programmiersprache JULIA, welche dem Syntax von MATLAB sehr ähnelt. Außerdem bietet JULIA große Performancevorteile gegenüber MATLAB, beim Lösen von z.B. komplexen Energienetzwerken [^34].

Ziel ist es ein eigenes JULIA-Package zu entwickeln, zur Simulation eines Energienetzwerks, bestehend aus gekoppelten Strom-, Gas- und Wärmekomponenten. Dieses Masterprojekt dient zur Einarbeitung in die Netzwerksimulation und in JULIA, einschließlich des `DifferentialEquations.jl` Pakets.

Das Masterprojekt wird in einem Pluto-Notebook geschrieben, um Programmcode interaktiv beschreiben zu können. Damit das Notebook nicht zu groß ist, wurde es in drei Notebooks aufgeteilt. In dem ersten Notebook wird der allgemeine Umgang von Pluto anhand von kleinen Beispielen erläutert. In dem zweiten Notebook wird JULIA eingeführt. In dem dritten Notebook werden zuerst numerische Methoden vorgestellt, um gewöhnliche Differentialgleichungen zu lösen und anschließend einige Methoden aus dem `DifferentialEquations.jl` Paket anhand eines einfachen Modells getestet. Zum Schluss wird die Netzwerksimulation mithilfe eines kleinen Netzwerks eingeführt. 
"

# ╔═╡ 6c118a17-54be-4280-b30a-8c1fe68d7262
md"# Pluto"

# ╔═╡ 182d0220-ba55-4057-9645-d471dbc0d1cb
md"Pluto ist ein interaktives Notebook, wie ein Jupiter-Notebook, welches speziell für die Programmiersprache Julia entwickelt wurde. In einem Pluto-Notebook können alle Analysen und Notizen von einem Projekt gespeichert und geteilt werden. Das besondere ist, dass in dem Notebook selbst Programmcode geschrieben werden kann, um beispielsweise den Verlauf einer Funktion grafisch darzustellen. Parameter können direkt in dem Notebook geändert werden, wodurch sich automatisch die Grafik ändert. [^25][^26] 
"

# ╔═╡ 8cfc799b-6a92-4f1e-94f6-9fed770277b3
a = 1

# ╔═╡ 116cc99c-3bea-4c4c-b03c-1e621bd3176a
let
	x = -10:0.1:10;
	y = a*x.^2;
	p = plot(x,y);
	md"""
	$(p)
	**Abbildung:** _Beispiel für den Verlauf der quadratischen Funktion: $$f(x) = ax^2$$_.
	"""
end

# ╔═╡ 0bb3ebf2-70b9-45e1-b7cd-cd9b4945fb2e
md"Ein Pluto-Notebook kann einfach im Webbrowser ausgeführt werden. Beim Erstellen eines neuen Notebooks wird eine `.jl` Datei erstellt. Das Notebook kann als `.jl` Datei, `.html` oder `.pdf` geteilt werden. [^25]

Ein weiterer großer Vorteil von Pluto ist, dass in der `.jl` Datei alle Pakete mit Versionsnummer, die in dem Notebook benutzt werden, aufgelistet sind. Beim Teilen des Notebooks wird so ermöglicht, dass alle Benutzer die exakt selbe Version haben und somit das Notebook mit allen Daten reproduziert werden kann. Dementsprechend kann es beim ersten Öffnen ein paar Minuten dauern, bis alle Pakete downgeloadet und installiert wurden. [^25]

In diesem Kapitel wird zuerst die Installation von Pluto und die ersten Schritte beschrieben. Anschließend wird der allgemeine Umgang von Pluto anhand von kleinen Beispielen erläutert.
"

