# ╔═╡ 7ad47c8c-5760-4323-9f36-635c4a6423f2
md"""
### Textfelder
"""

# ╔═╡ c55c8808-5061-4cfc-aab6-384b46f7b00e
md"In eine Zelle kann Julia Code eingegeben werden, aber auch Textfelder, um beispielsweise den Code oder Graphen zu beschreiben.

In jedem Pluto Notebook ist das Markdown Paket enthalten. Markdown ist eine Auszeichnungssprache zum Schreiben von Texten. Der Vorteil von Markdown ist, dass die Ausgangsform bereits vor der Konvertierung leicht lesbar ist. Es können aber auch andere Auszeichnungssprachen wie HTML, CSS oder JavaScript verwendet werden, um ein Textfeld zu erstellen. [^6][^36]"

# ╔═╡ c6f8a801-5ce4-411e-a275-0517d1218bd5
md"""Wenn ein Textfeld mit Markdown erstellt werden soll, muss folgender Syntax verwendet werden: [^5]

```
md"Hier kommt der Text hin.

Hier ist ein weitere Absatz."
```
"""

# ╔═╡ ae61578c-5013-4cfc-b154-f9c1077c56cb
md"""Um ein HTML Textfeld zu erstellen wird folgender Syntax benötigt: [^5]

```
html"<p>Hier kommt der Text hin. 
	 </p> 
	 <p> Hier ist ein weitere Absatz."
```

"""

# ╔═╡ b6199bfa-f9f2-474a-872c-6e51b34a569a
md"""
Wenn ein Textfeld Code enthalten soll, dieser aber nur zur Erklärung dienen, also nicht ausgeführt werden soll, muss das Textfeld wie folgt implementiert sein: 
	

	md\"\"\" Hier kommt Text hin.
	
	```julia
	x = -10:1:10
	y = 3*x
	```
	
	Hier kann weiterer Text geschrieben werden.
	\"\"\"

"""

