# ╔═╡ 2d374bdc-eedc-405f-a8a5-ffb7907e4031
md"### Codefelder"

# ╔═╡ 88824fa8-f064-40d8-b7e6-d50981bd6e19
md"Ein Zelle kann auch verwendet werden, um einfachen Julia Code zu implementieren und auszuführen. Damit das Notebook schneller läuft, wird empfohlen, dass nur ein Ausdruck in jeder Zelle eingegeben wird. Wenn z. B. mehrere Variablen in einer Zelle untereinander definiert sind, erhalten Sie folgende Fehlermeldung: [^25][^26]"

# ╔═╡ 6150af18-8ff3-452f-baf6-79846852f67d
b = 3
c = 4

# ╔═╡ 5ecc238e-7116-44ed-a3aa-aa00a54658e7
md"""Dieser Fehler kann entweder behoben werden, indem beide Ausdrücke in zwei Zellen aufteilen werden, oder indem 

```julia
begin
	b = 3
	c = 4
end
```
verwenden wird. [^26]
"""

# ╔═╡ 8a5a696d-e5e4-4d1b-841e-0e7ef85cf702
if @isdefined b 
md"Eine weitere Besonderheit in Pluto ist, dass die Reihenfolge in welcher Zelle eine Variable definiert ist, nicht relevant ist. D.h. sie kann sich an einem beliebigen Ort im Notebook befinden, obwohl die Variable bereits oberhalb benötigt wird: [^25][^26]"
else
md"---"
end

# ╔═╡ cc982488-8cb9-429f-9b98-3f598205d1b7
Aepfel = 4

# ╔═╡ e933498d-eb30-4a27-97ac-12be36124448
Bananen = 11

# ╔═╡ d2d54bad-c2a4-4ede-99b8-68a817f4ab65
Obst = Aepfel + Bananen

# ╔═╡ e67593a4-5f6c-44f5-9e84-a9577d439b69
md"Diese wirkt zunächst etwas merkwürdig, ermöglicht jedoch ein sehr reaktives Notebook, sodass sich alle abhängigen Zellen updaten, sobald eine Variable in einem beliebigen Feld geändert wird. Dies wird an folgendem Beispiel deutlich: [^25][^26]"

# ╔═╡ 96e6537f-fe05-4b84-85b5-93fa4c0867d9
@bind Burgersorte Select(["","Cheese-Burger","Bacon-Burger","Veggie-Burger"])

# ╔═╡ 5fc938ee-115c-448d-bb07-099c7a55e1bb
@bind Pommessorte Select(["","Pommes", "Potato Wedges", "Curly Fries"])

# ╔═╡ 3690772b-898c-4d7d-b4c0-065382cc6f30
@bind Getränk Select(["","Cola","Fanta","Sprite"])

# ╔═╡ 2fa270af-fb1c-4670-b298-5fad143b794c
md"""Aufgrund dieser Reaktivität ist es nicht möglich, dass dieselbe Variable in mehreren Zellen definiert wird. Folgendes Beispiel würde somit zu einem Fehler führen, da nicht klar ist, welcher Name gemeint ist: [^36]
```
md"Mein Name ist $name."
```

```
name = "Max"
```

```
name = "Lisa"
```

"""

# ╔═╡ ccfa1cf0-d8e0-4bd0-ad4e-1f4d0e0df316
md"Eine Möglichkeit dies zu umgehen ist anstatt `begin ... end` ➔ `let ... end` zu verwenden. [^36]"

# ╔═╡ ecd4e03f-7d1d-4873-af84-7e5c5a16df02
let
	name = "Max"
end

# ╔═╡ d4833917-9c5a-4465-93c3-eb6721c6f68d
let
	name = "Lisa"
end

# ╔═╡ d2701a7a-42a1-457b-aa1e-7082d5364f30
md"In einem `let` Block wird ein lokaler Bereich (hard local scope) erzeugt und somit kann die Ausgabe nicht in einer anderen Zelle verwendet werden: [^18][^36]" 

# ╔═╡ 33eeb6ff-c603-4724-8f1d-e77655ae1916
md"Mein Name ist $name."

# ╔═╡ e9e82e42-6522-4f5e-8ad2-03947a3e8aa3
if @isdefined name
	if ENV["USER"] == name
md"Dennoch kann Inhalt aus reaktiven Zellen von außerhalb in einer `let ... end` Umgebung verwendet werden:"
	else
md"---"
	end
else
md"---"	
end

# ╔═╡ e35b1c90-e7d6-4602-92e9-5b3871e4fe40
let
	Obst = Aepfel + Bananen
end

# ╔═╡ 6a2607a4-1167-47f7-87ff-90f0a905731d
md"In einem Jupiter-Notebook kann dieselbe Variable in mehreren Zellen definiert werden. Das Notebook verfügt jedoch nicht über die Reaktivität eines Pluto-Notebooks. D.h. es ändern sich nicht automatisch alle Zellen, in denen dieselbe Variable verwendet wird. Diese fehlende Reaktivität in einem Jupiter-Netbook kann zu Problemen führen, wenn beispielsweise eine Variable in einer Zelle gelöscht wird, aber nicht das ganze Notebook upgedatet wird. Zu einem späteren Zeitpunkt ist es dann schwerer nachzuvollziehen, warum bestimmte Zellen nicht mehr funktionieren. [^25][^26][^36]"

# ╔═╡ bb84d6ba-10a1-40a0-98a1-40b0e42a8eb8
md"### Interaktivität"

# ╔═╡ 54b511b4-5614-4a95-9dbc-887756e2b46c
md"In Pluto gibt es zahlreiche Möglichkeiten das Notebook interaktiver zu gestalten. Das `PlutoUI.jl` Paket, welches bereits ganz am [Anfang](#anfang) des Notebooks integriert ist, ermöglicht einfach Slider, Checkboxen, Auswahlfelder und weiters zu erstellen. [^36]"

# ╔═╡ 6a6347d1-fb1a-49ce-b220-d2863a08214a
@bind i Slider(1:15, default=1)

# ╔═╡ 67d25ccc-e2ce-4e6c-96ed-2550cdad7973
md"i = $i"

# ╔═╡ 3a972fb6-e795-489f-b3c9-ab01357adedb
let
	x = range(-4.0,stop=4.0,length=1000)
	y = exp.(-x.^2); 
	if i==1
	    x1 = [4.0];
	else
	    x1 = range(-4.0,stop=4.0,length=i); 
	end
	y1 = exp.(-x1.^2);
	pp = fit(x1,y1,i-1); y2 = pp.(x);
	p = plot(x1,y1, marker=:o, line = :scatter, ylims=(-1.1,1.1), legend = false); 
	plot!(x,y); 
	plot!(x,y2)
	md"""
	$(p)
	**Abbildung:** _Polynominterpolation_ [^34].
	"""
end

# ╔═╡ 8020fcdc-8d84-48f8-ace2-608307ffc90c
md"""
n = $(@bind n_New Slider(0:5, show_value=true, default=1))
"""

# ╔═╡ fb3da678-d42b-4e7f-8816-7899cf7598c0
md"""
x₀ = $(@bind x0_New Slider(-10:10, show_value=true, default=7))
"""

# ╔═╡ 2a6986a2-3372-4248-b5be-e1ce5be90892
begin
	function standard_Newton(f, n, x_range, x0, ymin=-10, ymax=10)
		    
		    f′ = x -> ForwardDiff.derivative(f, x)
		
		
			p = plot(f, x_range, lw=3, ylim=(ymin, ymax), legend=:false, size=(400, 300))
		
			hline!([0.0], c="magenta", lw=3, ls=:dash)
			scatter!([x0], [0], c="green", ann=(x0, -5, L"x_0", 10))
		
			for i in 1:n
		
				plot!([x0, x0], [0, f(x0)], c=:gray, alpha=0.5)
				scatter!([x0], [f(x0)], c=:red)
				m = f′(x0)
		
				plot!(x_range, [straight(x0, f(x0), x, m) for x in x_range], 
					  c=:blue, alpha=0.5, ls=:dash, lw=2)
		
				x1 = x0 - f(x0) / m
		
				scatter!([x1], [0], c="green", ann=(x1, -5, L"x_%$i", 10))
				
				x0 = x1
		
			end
		
			p |> as_svg
		
		
	end
	
	straight(x0, y0, x, m) = y0 + m * (x - x0)
	md""
end

# ╔═╡ f6bba2ce-31e5-46ad-9d44-ed10835988b3
let
	f(x) = 0.2x^3 - 4x + 1
	
	p = standard_Newton(f, n_New, -10:0.01:10, x0_New, -10, 70)
		md"""
	$(p)
	**Abbildung:** _Newtonverfahren_ [^27].
	"""
end

