md"In einem Pluto-Notebook können auch Hinweisfelder erstellt werden, um dem Benutzter beispielsweise Tipps zum Lösen einer Aufgabe zu geben. Die Hinweisfelder müssen in jedem Notebook als Funktionen definiert sein. In diesem Notebook befinden sich die Funktionen ganz am [Ende](#ende), sind jedoch ausgeblendet. [^36]"

# ╔═╡ 987f25da-0401-486f-931b-454cc88d090e
md"### $\LaTeX$ in Pluto"

# ╔═╡ 8c9a8da2-311f-40a4-95f8-18ea66e91435
md"""
Ein weiterer Vorteil von Pluto ist, dass ganz einfach $\LaTeX$ Formel in Markdown [Textfelder](#7ad47c8c-5760-4323-9f36-635c4a6423f2) eingefügt werden können. Der [Syntex](https://en.wikibooks.org/wiki/LaTeX/Mathematics) von $\LaTeX$ kann übernommen werden. Dafür gibt es mehrere Möglichkeiten: [^39]
1. Formeln können wie in $\LaTeX$ zwischen \$ Zeichen eingefügt werden:

	md"$\binom{n}{k} = \frac{n!}{k!(n - k)!}$"
"""

# ╔═╡ c5c2f974-6b0b-483e-a4bb-800aecfe40d1
md"**Ausgabe:**


$\binom{n}{k} = \frac{n!}{k!(n - k)!}$"

# ╔═╡ 4294bab4-77f7-4463-b40a-ab09532600b5
md"""
2. Der Formelmodus kann auch mit dem `math` Befehl aktiviert werden:

	
	md\"\"\"Für $n\in \mathbb{N}, k \in \mathbb{N_0}, k \leq n$ ist der Binomialkoeffizient $n$ über $k$ definiert durch: [^32]
	
	```math
	\binom{n}{k} = \frac{n!}{k!(n - k)!}
	```
	
	\"\"\"
	
"""

# ╔═╡ fc9c0430-703b-46f2-b247-9c7ae14a8780
md"""
**Ausgabe:**

Für $n\in \mathbb{N}, k \in \mathbb{N_0}, k \leq n$ ist der Binomialkoeffizient $n$ über $k$ definiert durch: [^32]

```math
\binom{n}{k} = \frac{n!}{k!(n - k)!}
```

"""

# ╔═╡ aa334f67-88f4-44a2-acb5-2486706d7772
md"""
3. Wenn mehrere Gleichungen untereinander angeordnet werden sollen, kann auch der Standard $\LaTeX$ Syntax `\begin{} ... \end{}` verwendet werden:

	md"$\begin{align}
						c^2 &= a^2 + b^2 \\
		\Longrightarrow |c| &= \sqrt{a^2 + b^2}
		\end{align}$"
"""

# ╔═╡ b1b7baa5-1cec-4100-a2b9-45b23309e27e
md"**Ausgabe:**

$\begin{align}
					c^2 &= a^2 + b^2 \\
	\Longrightarrow |c| &= \sqrt{a^2 + b^2}
\end{align}$"

# ╔═╡ 81d20853-37b2-4ee6-a7d6-f2b77b503ac2
md"""
4. Das `LaTeXStrings.jl` Paket ermöglicht, dass die Gleichungen interaktiv reagieren. Folgender Syntax wird benötigt: [^8]

```julia
using LaTeXStrings
```

```
s = 1
```

```
L"s = %$(s)"
```
"""

# ╔═╡ 9aec0913-77b0-4ea2-9064-84a951b76d76
md"**Ausgabe:**
"

# ╔═╡ 6f4f4e72-87b0-4742-96bd-0d14f51aac94
s = 1

# ╔═╡ 8474c1ce-2bd4-4c05-a763-7958c2f67843
L"s= %$(s)"

# ╔═╡ 670fd4f1-c8b6-4a23-b871-112a74f84224
md"""
n = $(@bind n Slider(0:20, show_value=true, default=0))
"""

# ╔═╡ c9251130-efa4-4db8-8ef5-26aeef31bd24
md"""
k = $(@bind k Slider(0:n, show_value=true, default=0))
"""

# ╔═╡ 0443954a-9de6-4329-b69c-61028a4da6dd
L"\binom{n}{k} = \frac{n!}{k!(n - k)!} = \binom{%$n}{%$k} = \frac{%$n !}{%$k ! %$(n-k)!} = %$(trunc(Int,factorial(n)/(factorial(k) * factorial(n - k))))"

