begin
	hint(text) = Markdown.MD(Markdown.Admonition("hint", "Tipp:", [text]));

	almost(text) = Markdown.MD(Markdown.Admonition("warning", "Fast richtig!", [text]));

	keep_working(text=md"Die Antwort ist leider nicht richtig.") = Markdown.MD(Markdown.Admonition("danger", "Falsch!", [text]));

	correct(text=md"Super! Die Antwort ist richtig! Fahren Sie fort zum nächten Abschnitt.") = Markdown.MD(Markdown.Admonition("correct", "Richtig!", [text]));

	task(text) = Markdown.MD(Markdown.Admonition("danger", "", [text]));

	hinweis(text) = Markdown.MD(Markdown.Admonition("correct", "Hinweis:", [text]))
end

