# ╔═╡ 103fa4fe-513e-40b2-b9c9-a307a6175ae7
task(md"Lösen Sie das Anfangswertproblem

$u'=\lambda u, \quad u(1) = 2, \quad \lambda = 3$

zum Zeitpunkt $\boldsymbol{t = 4}$ und schreiben Sie die Lösung von $\boldsymbol{u}$ in eine neue Zelle.
")

# ╔═╡ b46c5841-3459-4f1a-8a6c-0c8ddfb70f1b
if !@isdefined u
	hint(md"$y=y_0\cdot e^{\lambda(t-t_0)}$")
elseif u == 2*exp(3*4)
	almost(md"""Die Antwort ist leider nicht ganz richtig. Überlegen Sie nochmal wie groß die Zeit $t_0$ ist.

	**Hinweis:** $y=y_0\cdot e^{\lambda(t-t_0)}$
	""")
elseif u == 2*exp(3*(4-1))
	correct()
else
	keep_working(md"""Die Antwort ist leider nicht richtig. 

	**Hinweis:** $y=y_0\cdot e^{\lambda(t-t_0)}$
	""")
end

